import React from 'react'

const todo = ()=> {
    return( 
    <>
        <div className='main_div'>
            <div className="center_div">
                <br/>
                <h1> ToDo List</h1>
                <br/>
            </div>
        </div>
    </>
    );
};
export default todo;
